import React from 'react'
import { 
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom'

const styles = {
    backgroundColor : '#114',
    color : 'white',
    margin : 'auto',
    padding : '10px',
    position : 'fix'
}

const NavBar = props => {
    const navTitles = ['Home', 'About', 'Portfolio']
    const navItems = navTitles.map(title => <NavItem title={title}></NavItem>)
    return (
        <div style={styles}>
            <h1>Motorcyclers Schedule</h1>
            <ul>
                {navItems}
            </ul>
        </div>
    )
}

const NavItem = props => {
    return <li>{props.title}</li>
}

export default NavBar
